from sympy import divisors
from itertools import accumulate, count, islice
def D(m): return set(accumulate(divisors(m)[1:]))
def agen(): # generator of terms
    U = set()
    for m in count(1):
        debut = D(m) - U
        yield len(debut)
        U |= debut
print(list(islice(agen(), 100))) # _Michael S. Branicky_, Sep 06 2025

